import React from 'react';
import {Link} from 'react-router-dom';
import './Task_css.css';

function Main() {
  return (
  <>
  <div class="main">
  <h1>React Forms</h1>
  <Link to="/signup" id="link1" className="btn btn-primary">Signup</Link>
  <Link to="/login" id="link2">Login</Link>

  </div>

  </>
  );
}

export default Main;
